int ZipCode::findWH(vector<ZipCode> warehouses) {
	int bestin = -1;
	for (int i = 0; i < warehouses.size(); i++) {
		if (getTransit(warehouses[i])) {
			if (static_cast<int>(getState()) != static_cast<int>(warehouses[i].getState())) return i;
			else bestin = i;
		}
	}
	return bestin;
}

bool ZipCode::getTransit(ZipCode warehouse) {
	//return transit[warehouse.zipcode / 100 - 10][zipcode / 100 - 10]; //NOT FUCKING GENERAL
	//bool iftransitable = transit[warehouse.zipcode-1][zipcode-1] == 1;
	bool iftransitable = transit[warehouse.zipcode / 100 - 10][zipcode / 100 - 10] == 1;
	//cout << warehouse.zipcode-1 << ' ' << zipcode-1 << ' ' << iftransitable << endl;
	return iftransitable;
}

Placement::Placement(string givenName) {
	name = givenName;
	ifProper = true;
	vector<ZipCode> newthing(0);
	WHZips = newthing;
}
Placement Placement::clone () {
	Placement newplacement = Placement (name);
	newplacement.WHZips = WHZips;
	return newplacement;
}
void Placement::solve() {
	do {
		addBestWH();
		cout << (ifProper ? "Proper" : "Improper")  << endl;
	} while (!ifProper);
	removeRed();
}

void Placement::removeRed() {
	bool ifchanged = true;
	while (ifchanged) {
		bool ifchanged = false;
		for (int i = 0; i < WHZips.size(); i++) {
			Placement newplacement = clone();
			newplacement.WHZips.erase(newplacement.WHZips.begin() + i);
			double newomega = newplacement.getOmega();
			if (newplacement.ifProper) {
				ifchanged = true;
				WHZips = newplacement.WHZips;
				break;
			}
		}
	}
}

bool Placement::hasWarehouse (State state) {
	for (int i = 0; i < WHZips.size(); i++) {
		if (state == WHZips[i].getState()) return true;
	}
	return false;
}

//Checks if proper placement and adds zips to WH range
void Placement::setOmega() {
	ifProper = true;
	for (int i = 0; i < totalNumZips; i++) {
		ZipCode zip = ZipCode(i);
		int index = zip.findWH(WHZips);;
		if (index == -1) {
			ifProper = false;
		}
		else WHZips[index].range.push_back(zip);
	}
}

double Placement::getOmega() {
	setOmega();
	vector<double> nums(WHZips.size()), dens(WHZips.size());
	for (int i = 0; i < WHZips.size(); i++) {
		for (int j = 0; j < WHZips[i].range.size(); j++) {
			ZipCode zip = WHZips[i].range[j];
			int index = zip.findWH(WHZips);
			if (hasWarehouse(zip.getState())) {
				nums[index] += getTax(zip.getState()) * zip.population;
				dens[index] += getTax(zip.getState()) * zip.population;
			}
			else dens[index] += getTax(WHZips[i].getState()) * zip.population;
		}
	}
	double sumnum = accumulate(nums.begin(), nums.end(), 0.0);
	double sumden = accumulate(dens.begin(), dens.end(), 0.0);
	if (sumden == 0) sumden = .000001;
	return sumnum / sumden;
}

void Placement::addBestWH() {
	//if (WHZips.size() >= totalNumZips) return;
	ofstream fout(name, std::ios::app);

	double bestomega = 100000;
	Placement bestplacement = Placement(name);
	for (int i = 0; i < totalNumZips; i++) {
		ZipCode newzip = ZipCode(i);
		if (newzip.population < 5) continue;

		bool invalid = false;
		for (int j = 0; j < bestplacement.WHZips.size(); j++) {
			if (bestplacement.WHZips.size() > 0 && abs(newzip.zipcode - bestplacement.WHZips[j].zipcode)<750)invalid = true;
			if (newzip.zipcode == bestplacement.WHZips[j].zipcode) invalid = true;
			
		}
		//cout << "ifused" << ifused << endl << endl;
		if (invalid) continue;
		Placement newplacement = clone();
		newplacement.WHZips.push_back(newzip);
		double newomega = newplacement.getOmega();
		//cout << "newomega = " << newomega << endl;
		// GOING TO CHECK GETOMEGA();
		fout << newzip.zipcode << '\t' << newomega << endl;
		//cout << (i%100==0)?"x":"";
		if (newomega < bestomega) {
			bestomega = newomega;
			bestplacement = newplacement.clone();
		}
	}
	cout << "Warehouse added: " << bestomega << endl;
	cout << bestplacement.WHZips[bestplacement.WHZips.size()-1].zipcode << endl;
	WHZips = bestplacement.WHZips;
	setOmega();
}

